import { useForm } from "react-hook-form";



const Log = () => {


    const { register, handleSubmit } = useForm();

    const enviar = (e) => {
        e.defaultValue();
        alert(register)
     }


    return (
        <div>
            <br /><br />
            <form onSubmit={enviar}>

                <div class="input-group mb-3">
                    <input type="busqueda" onChange={(e) => register(...register,e.target.value)} class="form-control" minlength="1" placeholder="busqueda" aria-label="Recipient's username" aria-describedby="button-addon2" required />
                    <button class="btn btn-outline-secondary" type="submit" id="button-addon2">Filtrar</button>
                </div>
            </form>

        </div>
    )
}

export default Log
